import React from 'react';
import { Button, Form, FormGroup, Input, Container, Col } from 'reactstrap';

import './login.css';
const LoginPage = (props) => {
  return (
      <Container>
        <Form>
            <h1>Login</h1>
        <FormGroup>
            <Input type="email" name="email" id="exampleEmail" placeholder="usernmae" />
        </FormGroup>
        <FormGroup>
            <Input type="password" name="password" id="examplePassword" placeholder="password" />
            <Col sm={4}>
                <Input type="email" name="email" id="exampleEmail" placeholder="lg"  />
            </Col>
        </FormGroup>
        <Button>Login</Button>
       </Form>
      </Container>
  );
}

export default LoginPage;
